import "./App.css";
import React from "react";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="main">
      <h1> WAR </h1>
      <div id="cardPlaceholders">
        <div id="rectangle1"></div>
        <div id="rectangle2"></div>
      </div>
    </div>
  );
}

export default App;
